    return (
        <Fragment>
            <div className='flex items-center justify-between px-20 bg-white'>
                <Link to={"/"} className='p-3'>
                    <img src="https://yt3.googleusercontent.com/HnAnUZS7d8LFtPHaHRtPH9nMoUmrsBBy_FDD-T-YQIycPW55peuWo1NO_rxPIswDbukXYlk7=s176-c-k-c0x00ffffff-no-rj" className='h-[50px] rounded-full mr-5' alt="" />
                </Link>
                <h3 className='text-2xl font-medium text-black'>CHECKOUT</h3>
                <div className='flex text-sm'>
                    <p className='text-[#646464] font-normal '>Having troubles? Call us: </p>
                    <p className='font-medium text-black'>+44 (0) 2076604453</p>
                </div>
            </div>
            <div className=''>

            </div>
        </Fragment>
    );
};

export default Checkout;
